'{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "description": "Unloading Container Count with Centered Data Labels",
  "title": {
    "text": "Full Drop Off Container Count",
    "anchor": "start"
  },
  "data": {
    "name": "dataset"
  },
  "transform": [
    {
      "window": [
        {"op": "sum", "field": "Count", "as": "sum_count"}
      ],
      "groupby": ["Warehouse"],
      "frame": [null, null]
    },
    {
      "window": [
        {"op": "sum", "field": "Count", "as": "cumulative_count"}
      ],
      "sort": [{"field": "Status", "order": "ascending"}],
      "groupby": ["Warehouse"],
      "frame": [null, 0]
    },
    {
      "calculate": "datum.cumulative_count - datum[''Count'']/2",
      "as": "center_position"
    }
  ],
  "layer": [
    {
      "mark": "bar",
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
          "sort": "-x",
          "axis": {"title": null}
        },
        "x": {
          "field": "Count",
          "type": "quantitative",
          "title": "",
          "stack": "zero"
        },
        "color": {
          "field": "Status",
          "type": "nominal",
          "scale": {
            "domain": ["Containers Ready for Transport to Warehouse", "Containers to Arrive at Warehouse"],
            "range": ["#1FB6FF", "#101357"]
          },
          "legend": {
            "title": "Lead Times"
          }
        }
      }
    },
    {
      "mark": {
        "type": "text",
        "align": "center",
        "baseline": "middle",
        "color": "white"
      },
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
          "sort": "-x"
        },
        "x": {
          "field": "center_position",
          "type": "quantitative"
        },
        "text": {
          "field": "Count",
          "type": "quantitative"
        }
        ,
          "tooltip": [
    {"field": "Warehouse"},
    {"field": "Status"},
    {"field": "Count", "type": "quantitative"}
  ]
      }
    },
    {
      "data": {
        "name": "dataset"
      },
      "transform": [
        {
          "aggregate": [
            {"op": "sum", "field": "Count", "as": "Count"}
          ],
          "groupby": ["Status"]
        },
        {
          "calculate": "''TOTAL''", 
          "as": "Warehouse"
        },
        {
          "window": [
            {"op": "sum", "field": "Count", "as": "sum_count"}
          ],
          "groupby": ["Warehouse"],
          "frame": [null, null]
        },
        {
          "window": [
            {"op": "sum", "field": "Count", "as": "cumulative_count"}
          ],
          "sort": [{"field": "Status", "order": "ascending"}],
          "groupby": ["Warehouse"],
          "frame": [null, 0]
        },
        {
          "calculate": "datum.cumulative_count - datum[''Count'']/2",
          "as": "center_position"
        }
      ],
      "mark": {"type": "bar", "stroke": "black", "strokeWidth": 0},
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal"
        },
        "x": {
          "field": "Count",
          "type": "quantitative",
          "stack": "zero"
        },
        "color": {
          "field": "Status",
          "type": "nominal",
          "scale": {
            "domain": ["Containers Ready for Transport to Warehouse", "Containers to Arrive at Warehouse"],
            "range": ["#1FB6FF", "#101357"]
          }
        },
          "tooltip": [
    {"field": "Warehouse"},
    {"field": "Status"},
    {"field": "Count", "type": "quantitative"}
  ]
      }
    },
    {
      "data": {
        "name": "dataset"
      },
      "transform": [
        {
          "aggregate": [
            {"op": "sum", "field": "Count", "as": "Count"}
          ],
          "groupby": ["Status"]
        },
        {
          "calculate": "''TOTAL''", 
          "as": "Warehouse"
        },
        {
          "window": [
            {"op": "sum", "field": "Count", "as": "sum_count"}
          ],
          "groupby": ["Warehouse"],
          "frame": [null, null]
        },
        {
          "window": [
            {"op": "sum", "field": "Count", "as": "cumulative_count"}
          ],
          "sort": [{"field": "Status", "order": "ascending"}],
          "groupby": ["Warehouse"],
          "frame": [null, 0]
        },
        {
          "calculate": "datum.cumulative_count - datum[''Count'']/2",
          "as": "center_position"
        }
      ],
      "mark": {
        "type": "text",
        "align": "center",
        "baseline": "middle",
        "color": "white"
      },
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal"
        },
        "x": {
          "field": "center_position",
          "type": "quantitative"
        },
        "text": {
          "field": "Count",
          "type": "quantitative"
        }
      }
    }
  ]
}'
